import React ,{useEffect}from 'react';

import { Link } from 'react-router-dom';
const Adminnav = () => {

  useEffect(()=>{
 
    const menuBtn = document.querySelector('.menu-btnn');
    const menuBtnn = document.querySelector('.menu-btn_burger');
    let menuOpen = false;
    menuBtn.addEventListener('click', () => {
      if(!menuOpen) {
        menuBtn.classList.add('open');
        menuBtnn.classList.add('activebutton');
        menuOpen = true;
      } else {
        menuBtn.classList.remove('open');
       
        menuOpen = false;
      }
    });
    
    
    
    
  },[])
    return ( 
      <React.Fragment>
      
      <button className=" menu-btnn  navbar-toggler navbar-brand" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
      <div className="menu-btn_burger"></div>
       </button>
       
  <div style={{borderRadius:"50px"}} class=" rounded collapse nav-collapse" id="navbarSupportedContent">
  
  <ul class="navbar-nav mr-auto">
      <li class="nav-item active">
        <a class="nav-link" href="#">Home <span class="sr-only">(current)</span></a>
      </li>
      <li class="nav-item">
        <a class="nav-link" href="#">Link</a>
      </li>
      </ul>
    
    
  </div> 
        </React.Fragment>
     );
}
 
export default Adminnav;
